import logo from './logo.svg';
import './App.css';

function App() {
  const list = ['item1','item2','item3','item4']
  function Lijst(){
    return(
      <ul>
       list.map((listItem) =>{ <li>{listItem}</li> })
       </ul>
    )
    }
  return (
    <div className="App">
      <header className="App-header">
        <p>
          hallo hallo hallo

        </p>
        <Lijst/>
        <a
          className="App-link"
          href="https://reactjs.org"
          target="_blank"
          rel="noopener noreferrer"
        >
          Learn React
        </a>
      </header>
    </div>
  );
}

export default App;
